import React, {Component} from 'react';
import { connect } from 'react-redux';
import { startTest } from '../store';
import { checkTest } from '../store';
import Start from '../components/Start';
import Answer from '../components/Answer';
import Check from '../components/Check';


class Test extends Component {
  constructor(props) {
    super(props);
    qnumber:0;
    this.doStart = this.doStart.bind(this);
    this.doCheck = this.doCheck.bind(this);
  }

  doStart(e){
    let action = startTest();
    this.props.dispatch(action);
  }
  doCheck(e){ 
    var choise = e.target.id;
    let action = checkTest(choise);
    this.props.dispatch(action);
  }
  render(){
    if (this.props.status=="default"){   
      return(
        <Start />     
      )
    } else if (this.props.status=="start") {
      return(   
        <Answer />   
      )
    } else if (this.props.status=="check") {      
      return(
        <Check /> 
      )
    }
  }
}
Test = connect((state) => state)(Test);
export default Test;
